import React from 'react';
import styles from './Publication.module.css';

const Publication = () => {
  const [like, setLike] = useState(post.amountLike);
  return (
    <div className={styles.main}>
      <img
        className={styles.image}
        src="http://www.wpkixx.com/html/winku-dark/images/resources/admin2.jpg"
        alt="my image"
      />
      <input className={styles.box} placeholder="write something" />
      <div className={styles.like} onClick={() => setLike(like + 1)}>
        {' '}
        like: 1 {like}
      </div>
    </div>
  );
};

export default Publication;
